import { List, Header, Table } from 'semantic-ui-react';

const Products = ({products}) => {
    return ( 
        <Table>
            <Table.Header>
                <Table.Row>
                    <Table.HeaderCell>Name</Table.HeaderCell>
                    <Table.HeaderCell>Preis in <Icon name='euro sign' /></Table.HeaderCell>
                    <Table.HeaderCell>Name</Table.HeaderCell>
                </Table.Row>
            </Table.Header>


            {products.map(product => {
                    return(
                        <List.Item key={product.id}>
                            <Header>{product.name}</Header>
                            <List.Content>Preis: {product.price}</List.Content>
                            <List.Content>Haltbarkeit in Tagen: {product.durability}</List.Content>
                        </List.Item>
                    )
                })}
        </Table>
     );
}
 
export default Products;
